import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://cdn.logo.com/hotlink-ok/logo-social.png" alt="kartinka" />
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
      </nav>
      <div>Main content</div>
    </div>
  );
};

export default App;
